import React, { Component } from 'react';
import "bulma/css/bulma.css";
import './Navbar.css';
import Github from '../Images/github_logo.png'
import LinkedIn from '../Images/linkedin_logo.png'
import { Link } from "react-router-dom";


// const [isActive, setActive] = React.useState(false);

class Navbar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      isActive: false,
      about: "white",
      resume: "white",
      projects: "white",
      contact: "white"
    };
  }

  responsiveNavbar = () => {
    this.setState({ isActive: !this.state.isActive })
    console.log(this.state.isActive)
  };

  submitData = (item) => {
    if(item == "about"){
      this.setState({ isActive: false,
                      about: "#d3d3d3",
                      resume: "white",
                      projects: "white",
                      contact: "white"})

    }
    else if(item == "resume"){
      this.setState({ isActive: false,
                      about: "white",
                      resume: "#d3d3d3",
                      projects: "white",
                      contact: "white"})
    }
    else if(item == "projects"){
      this.setState({ isActive: false,
                      about: "white",
                      resume: "white",
                      projects: "#d3d3d3",
                      contact: "white"})
    }
    else if(item == "contact"){
      this.setState({ isActive: false,
                      about: "white",
                      resume: "white",
                      projects: "white",
                      contact: "#d3d3d3"})
    }

    console.log(item)
  };

  render() {
    return (
    <div>
    <nav className="navbar" role="navigation" aria-label="main navigation">
      <div className="navbar-brand">
        <div className="navbar-item">
          <div className="my_Label">
            Brendan Muldowney
          </div>
        </div>
        <a onClick={() => this.responsiveNavbar()} role="button"
           className={"navbar-burger burger" + (this.state.isActive ? "is-active" : "") }
           aria-label="menu" aria-expanded="false" data-target="navbarBasicExample">
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
          <span aria-hidden="true"></span>
        </a>
      </div>

      <div id="navbarBasicExample" className={"navbar-menu" + (this.state.isActive ? "is-active" : "") }>
        <div className="navbar-start">
        <Link to="/about" onClick={() => this.submitData("about")} style={{backgroundColor:this.state.about}}>

            <a className="navbar-item"  >
                About
            </a>
            </Link>

          <a className="navbar-item" onClick={() => this.submitData("resume")} style={{backgroundColor:this.state.resume}}>
            <Link to="/resume">
              Resume
            </Link>
          </a>
          <a className="navbar-item" onClick={() => this.submitData("projects")} style={{backgroundColor:this.state.projects}}>
            <Link to="/projects">
              Projects
            </Link>
          </a>
          <a className="navbar-item" onClick={() => this.submitData("contact")} style={{backgroundColor:this.state.contact}}>
            <Link to="/contact">
              Contact
            </Link>
          </a>
        </div>

        <div className="navbar-end">
          <div className="navbar-item">
            <div className="buttons">
              <a className="button is-link is-outlined" href="https://github.com/brendmm" target="_blank">
                <img src={Github} width="30" height="30"/>
              </a>
              <a className="button is-link is-outlined" href="https://www.linkedin.com/in/brendan-muldowney-892895132/" target="_blank">
                <img src={LinkedIn} width="30" height="30"/>
              </a>
            </div>
          </div>
        </div>
      </div>
    </nav>
    </div>
    );
  }
}

export default Navbar;
